import React, { Component } from "react";
import PokemonList from "../pokemon/PokemonList";

export default class Dashboard extends Component {
  render() {
    const { generations } = this.props.match.params;
    return (
      <div className="row">
        <div className="col">
          <PokemonList generations={generations} />
        </div>
      </div>
    );
  }
}
